from typing import List

def candidate(paren_string: str) -> List[str]:
    cleaned = paren_string.replace(' ', '')
    result = []
    start = 0
    balance = 0
    for i, char in enumerate(cleaned):
        if char == '(':
            balance += 1
        else:
            balance -= 1
        if balance == 0:
            result.append(cleaned[start:i+1])
            start = i + 1
    return result
